/**
 * @constant DATA_ORIGINAL_SRC
 * @type {String}
 */
const DATA_ORIGINAL_SRC = 'data-src-original';

/**
 * @method transform
 * @param {Element} img
 * @param {Object} [factor]
 * @return {Element}
 */
export function transform(img, { factor = .05 } = {}) {

    const src       = img.getAttribute(DATA_ORIGINAL_SRC) || img.getAttribute('src');
    const original  = createImage(src);
    const canvas    = document.createElement('canvas');
    const context   = canvas.getContext('2d');
    const brick     = 'data:image/png;base64,';
    const isFirefox = navigator.userAgent.toLowerCase().indexOf('firefox') > -1;

    /**
     * @method getDimension
     * @param {String} property
     * @return {Number}
     */
    const getDimension = property => {
        return parseInt(getComputedStyle(img).getPropertyValue(property));
    };

    // Memorise the original image's source if we haven't already.
    !img.hasAttribute(DATA_ORIGINAL_SRC) && img.setAttribute(DATA_ORIGINAL_SRC, src);

    original.addEventListener('load', () => {

        const size   = factor * 400;
        const height = Math.ceil(getDimension('height') / size) * size;
        const width  = Math.ceil(getDimension('width') / size) * size;
        const small  = { height: height / size, width: width / size };

        // Configure the canvas.
        canvas.width  = width;
        canvas.height = height;

        // Setup the pixelation of the source image on the canvas.
        context.mozImageSmoothingEnabled = false;
        context.webkitImageSmoothingEnabled = false;
        context.imageSmoothingEnabled = false;
        context.drawImage(original, 0, 0, small.width, small.height);
        context.rect(0, 0, width, height);
        context.drawImage(canvas, 0, 0, small.width, small.height, 0, 0, width, height);

        // Apply the canvas to the SVG and place the Lego blocks on top.
        const svg = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                        <defs>
                            <pattern id="bricks" patternUnits="userSpaceOnUse" width="${size}" height="${size}">
                                <image xlink:href="${brick}" width="${size}" height="${size}" x="0" y="0" />
                            </pattern>
                        </defs>
                        <g transform="scale(${isFirefox ? 2 : 1})">
                            <image width="${width}" height="${height}" x="0" y="0" xlink:href="${canvas.toDataURL()}" />
                            <rect style="mix-blend-mode: overlay" fill="url(#bricks)" x="0" y="0" width="${width}" height="${height}" />
                        </g>
                     </svg>`;

        // Define the image's src which is the newly created SVG element.
        const src = `data:image/svg+xml;base64,${btoa(svg)}`;
        img.setAttribute('src', src);

    });

}

/**
 * @method createImage
 * @param {String} src
 * @return {Image}
 */
function createImage(src) {
    const image = new Image();
    image.setAttribute('src', src);
    return image;
}
